import CmpCategory from './page/admin/CmpCategory';
import CmpLogin from './page/CmpLogin';
import CmpRegistration from './page/CmpRegistration';
import CmpCreateJob from './page/CmpCreateJob';
import Layout from '.'

function App()
 {
  return (
    <div class="app">
      <BrowserRouter>
      <Routes>

      <Route index element={<Layout/>}/ >
        <Route path='/cmpcat' element={<CmpCategory/>}/ > 
        <Route path='/cmpreg' element={<CmpRegistration/>}/ >
        <Route path='/cmpc' element={<CmpCreateJob/>}/ >



      </Routes>
      </BrowserRouter>
    </div>
  );
}
export default App;
